export function haversineKm(a, b) {
  const R = 6371;
  const dLat = ((b.lat - a.lat) * Math.PI) / 180;
  const dLng = ((b.lng - a.lng) * Math.PI) / 180;
  const lat1 = (a.lat * Math.PI) / 180;
  const lat2 = (b.lat * Math.PI) / 180;
  const sinDLat = Math.sin(dLat / 2);
  const sinDLng = Math.sin(dLng / 2);
  const h =
    sinDLat * sinDLat +
    sinDLng * sinDLng * Math.cos(lat1) * Math.cos(lat2);
  const c = 2 * Math.atan2(Math.sqrt(h), Math.sqrt(1 - h));
  return R * c;
}

export function getTransport(origin, destination, neighbourhoodCenters, transportTable) {
  if (origin === destination) return { mode: 'Walk', fare: 0, minutes: 0 };
  const directKey = `${origin}|${destination}`;
  if (transportTable[directKey]) return transportTable[directKey];

  // Fallback: approximate matatu between centres by straight-line distance
  const originCenter = neighbourhoodCenters[origin];
  const destCenter = neighbourhoodCenters[destination];
  if (!originCenter || !destCenter) {
    return { mode: 'Matatu', fare: 80, minutes: 45 };
  }
  const km = haversineKm(originCenter, destCenter);
  const fare = Math.round(Math.max(30, km * 8));
  const minutes = Math.round(Math.max(10, km * 3));
  return { mode: 'Matatu', fare, minutes };
}

export function stage1SpatialSearch(places, neighbourhoodCenters, startNeighbourhood, radiusKm = 20) {
  const center = neighbourhoodCenters[startNeighbourhood];
  if (!center) return [];
  return places.filter((p) => {
    const d = haversineKm(center, p.coords);
    return d <= radiusKm;
  });
}

export function stage2BudgetFilter(candidates, totalBudget) {
  const threshold = totalBudget * 0.6;
  return candidates.filter((p) => {
    const placeCost = p.entryFee + p.avgFood;
    return placeCost <= threshold;
  });
}

export function textMatchBoost(place, queryTokens) {
  if (queryTokens.length === 0) return 0;
  const haystack = [
    ...place.tags,
    ...place.vibes,
    place.name,
    place.category,
  ]
    .join(' ')
    .toLowerCase();
  let matches = 0;
  for (const token of queryTokens) {
    if (haystack.includes(token)) matches += 1;
  }
  return Math.min(1, matches / queryTokens.length);
}

export function stage3ScoreAndRank(
  candidates,
  preferredCategories,
  preferredVibes,
  freeText
) {
  const catSet = new Set(preferredCategories);
  const vibeSet = new Set(preferredVibes.map((v) => v.toLowerCase()));
  const tokens =
    freeText
      ?.toLowerCase()
      .split(/\s+/)
      .filter((t) => t.length > 2) ?? [];

  return candidates
    .map((p) => {
      const ratingNorm = p.rating / 5;
      const ratingScore = ratingNorm;

      const categoryMatch = catSet.size
        ? catSet.has(p.category)
          ? 1
          : 0
        : 0.5;
      const categoryScore = categoryMatch;

      const vibeMatches = p.vibes.filter((v) =>
        vibeSet.has(v.toLowerCase())
      ).length;
      const vibeScore = Math.min(1, vibeMatches / 2);

      const popularityScore = p.popularity ?? 0.5;

      const textBoost = textMatchBoost(p, tokens);

      const baseScore =
        ratingScore * 0.3 +
        categoryScore * 0.3 +
        vibeScore * 0.2 +
        popularityScore * 0.2;
      const finalScore = baseScore + textBoost * 0.2;
      return { place: p, score: finalScore };
    })
    .sort((a, b) => b.score - a.score);
}

export function stage4ItinerarySolver(
  ranked,
  startNeighbourhood,
  totalBudget,
  totalMinutes,
  neighbourhoodCenters,
  transportTable
) {
  let remainingBudget = totalBudget;
  let remainingMinutes = totalMinutes;
  let currentNeighbourhood = startNeighbourhood;

  const stops = [];

  for (const { place, score } of ranked) {
    const transport = getTransport(
      currentNeighbourhood,
      place.neighbourhood,
      neighbourhoodCenters,
      transportTable
    );
    const placeCost = place.entryFee + place.avgFood;
    const totalCost = transport.fare + placeCost;
    const totalTime = transport.minutes + place.durationMin;

    if (totalCost <= remainingBudget && totalTime <= remainingMinutes) {
      stops.push({
        place,
        score,
        transport,
        costBreakdown: {
          transport: transport.fare,
          entry: place.entryFee,
          food: place.avgFood,
          total: totalCost,
        },
        timeBreakdown: {
          travel: transport.minutes,
          visit: place.durationMin,
          total: totalTime,
        },
      });
      remainingBudget -= totalCost;
      remainingMinutes -= totalTime;
      currentNeighbourhood = place.neighbourhood;
    }
  }

  return {
    stops,
    remainingBudget,
    remainingMinutes,
  };
}

export function generateItinerary(
  geoData,
  startNeighbourhood,
  totalBudget,
  totalHours,
  preferredCategories,
  preferredVibes,
  freeText
) {
  const { places, neighbourhoodCenters, transportTable } = geoData;
  const totalMinutes = totalHours * 60;

  // Stage 1
  const spatialCandidates = stage1SpatialSearch(
    places,
    neighbourhoodCenters,
    startNeighbourhood
  );

  // Stage 2
  const budgetCandidates = stage2BudgetFilter(spatialCandidates, totalBudget);

  // Stage 3
  const ranked = stage3ScoreAndRank(
    budgetCandidates,
    preferredCategories,
    preferredVibes,
    freeText
  );

  // Stage 4
  const result = stage4ItinerarySolver(
    ranked,
    startNeighbourhood,
    totalBudget,
    totalMinutes,
    neighbourhoodCenters,
    transportTable
  );

  return result;
}
